import AwesomeSlider from 'react-awesome-slider';
import 'react-awesome-slider/dist/styles.css';

const slider = (
  <AwesomeSlider>
    <div data-src="./image/hell.jpg" />
    <div data-src="./image/enojao.jpg" />
    <div data-src="./image/dragon.jpg" />
  </AwesomeSlider>
);
